@Override public QuitLineupCsReq mergeFrom(final QuitLineupCsReq other){
  if (other.isEmpty()) {
    return this;
  }
  cachedSize=-1;
  if (other.hasPlaneId()) {
    setPlaneId(other.planeId);
  }
  if (other.hasBaseAvatarId()) {
    setBaseAvatarId(other.baseAvatarId);
  }
  if (other.hasIndex()) {
    setIndex(other.index);
  }
