  if (checkRT < task.getCheckRTBest()) {
    task.setCheckRTBest(checkRT);
  }
  checkRT=(long)((params.getFactor() * task.getCheckRTNormalized()) + (1 - params.getFactor()) * checkRT);
  if (checkRT > params.getMax()) {
