        Logging.debug("\"" + symbol.getName() + "()\" called at "+ fromAddress.toString()+ " from \""+ caller.getName()+ "()\" function");
        Logging.debug("Checking path from \"" + caller.getName() + "()\" to \""+ openName+ "()\"");
