    if (StringUtils.isNotEmpty(rawPidStr)) {
      mat=MACPATTERN.matcher(rawPidStr);
    }
  }
 else   if (SystemUtils.IS_OS_LINUX) {
    if (StringUtils.isNotEmpty(rawPidStr)) {
      mat=LINUXPATTERN.matcher(rawPidStr);
    }
  }
 else {
    if (StringUtils.isNotEmpty(rawPidStr)) {
      mat=WINDOWSPATTERN.matcher(rawPidStr);
    }
  }
  if (null != mat) {
    while (mat.find()) {
      allPidList.add(mat.group(1));
    }
  }
